import { AppBar, Box, Toolbar, Typography } from "@mui/material";
import { Container } from "@mui/system";

export default function NavBar() {
    return (
        <Box>
            <AppBar position="static" color="transparent">
                <Container>
                    <Toolbar>
                        <Typography>
                            INventory sistem
                        </Typography>
                    </Toolbar>
                </Container>
            </AppBar>
        </Box>
    )
}
